import React from "react";
import { useNavigate } from "react-router-dom";
import { 
  Container, 
  Typography, 
  Paper
} from '@mui/material';
import Button from '../components/Button';
import styles from './styles/HomePage.module.css';

function HomePage() {
  const navigate = useNavigate();
  const tenantId = 1;

  const handleOrganisationsClick = () => {
    navigate('/organisations', { state: { tenantId } });
  };

  return (
    <Container className={styles.container}>
      <Paper className={styles.paper} elevation={3}>
        <div className={styles.welcomeBox}>
          <Typography 
            variant="h3" 
            component="h1" 
            className={styles.title}
          >
            Welcome to Requirements Tracker
          </Typography>
          <Typography 
            variant="h6" 
            className={styles.subtitle}
          >
            Your central hub for managing requirements and organizations
          </Typography>
        </div>
        
        <Typography 
          variant="body1" 
          className={styles.description}
        >
          Select an option from the menu above to get started, or use the button below to view organizations.
        </Typography>

        <Button 
          variant="primary"
          size="large"
          onClick={handleOrganisationsClick}
        >
          View Organisations
        </Button>
      </Paper>
    </Container>
  );
}

export default HomePage;
